import logo from "./logo.svg";
import "./App.css";
import DoneBtn from "./Button";

const TodoList = (props) => {
  return <div> I need to {props.todo}</div>;
};

const SubTodoList = (propss) => {
  return <div> When I have time, I can {propss.subtodo}</div>;
};

const HighPriority = [
  "do Danish homework",
  "do React homework",
  "grocery shop",
];

function App() {
  return (
    <div className="App">

      {HighPriority.map((todo) => {
        return 
        <div>
          <TodoList key={todo} todo={todo} />
          {/* <input type="checkbox"/>; */}
        </div>
      })}

      <SubTodoList subtodo="cleaning house" />
    </div>
  );
}

export default App;
